contract StablecoinStakeToken is ERC721, Initializable {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    address private immutable _stablecoinTokenAddress;
    address private immutable _automatedInvestorAddress;

    address private _songManagerAddress;
    address private _traxStakeTokenAddr;

    // token name
    string private _proxyName;

    // token symbol
    string private _proxySymbol;

    mapping(uint256 => uint256) public tokenStakedAmount;
    mapping(uint256 => uint256) public tokenParentNFTId;

    event StakeTokens(address indexed holder, uint256 nftId, uint256 position, uint256 amount);

    /**
     * @dev in construction time we can only save the immutable members
     *      because of the use of proxies
     */
    constructor(address stablecoinTokenAddress, address automatedInvestorAddress)
        ERC721("Privi Stablecoin Stake Token", "pSST")
    {
        _stablecoinTokenAddress = stablecoinTokenAddress;
        _automatedInvestorAddress = automatedInvestorAddress;
    }

    /**
     * @dev set the name and symbol of the token in the proxy
     */
    function initialize(
        string calldata _name,
        string calldata _symbol,
        address __traxStakeTokenAddr
    ) external initializer {
        _proxyName = _name;
        _proxySymbol = _symbol;

        // the song manager created the proxies
        _songManagerAddress = msg.sender;
        _traxStakeTokenAddr = __traxStakeTokenAddr;
    }

    /**
     * @dev See {IERC721Metadata-name}.
     */
    function name() public view override returns (string memory) {
        return _proxyName;
    }

    /**
     * @dev See {IERC721Metadata-symbol}.
     */
    function symbol() public view override returns (string memory) {
        return _proxySymbol;
    }

    /**
     * @notice allows an account to stake stablecoin tokens for a position
     * @param _nftId the id of the nft unlocking the position
     */
    function stake(uint256 _nftId, uint256 _amount) external {
        require(IERC721(_traxStakeTokenAddr).ownerOf(_nftId) == msg.sender, "Should own the nft");

        uint256 positionIndex = TraxStakeToken(_traxStakeTokenAddr).tokenPositionIndex(_nftId);

        require(
            IERC20(_stablecoinTokenAddress).transferFrom(msg.sender, _automatedInvestorAddress, _amount),
            "Failed to transfer"
        );

        _tokenIds.increment();
        uint256 newTokenId = _tokenIds.current();

        _mint(msg.sender, newTokenId);
        tokenStakedAmount[newTokenId] = _amount;
        tokenParentNFTId[newTokenId] = _nftId;

        emit StakeTokens(msg.sender, newTokenId, positionIndex, _amount);
    }
}
